import React, {FC} from 'react';
import {Alert} from "@mui/material";

export interface WinnerAlertProps{
    player:string
}
const WinnerAlert:FC<WinnerAlertProps> = ({player}) => {
    if(player==='none')
    return (
        <div>
            <Alert severity={'success'}
                   style={{
                       visibility:'hidden'
                   }}
            />
        </div>
    );
    else{
        return (
            <div>
                <Alert severity={'success'}
                       style={{
                           visibility:'hidden'
                       }}
                >
                {player}
                </Alert>
            </div>
        );
    }
};

export default WinnerAlert;
